(16, 1, 'faq_1_answer', 'Go to Sales â†’ Create Invoice or press Ctrl+I. Fill in customer details, add products, and click Save. The invoice will be automatically numbered and ready for printing.', 'faq', 'FAQ 1 Answer', 'textarea', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
(17, 1, 'faq_2_question', 'How do I add a new product to inventory?', 'faq', 'FAQ 2 Question', 'text', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
(18, 1, 'faq_2_answer', 'Navigate to Inventory â†’ Products â†’ Add Product. Enter product details including HSN code, GST rate, and pricing. You can also import products in bulk using CSV.', 'faq', 'FAQ 2 Answer', 'textarea', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
(19, 1, 'faq_3_question', 'How can I generate GST reports?', 'faq', 'FAQ 3 Question', 'text', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
(20, 1, 'faq_3_answer', 'Go to Reports â†’ GST Reports. You can generate GSTR-1, GSTR-3B, and other GST reports. Select the date range and export in Excel or PDF format.', 'faq', 'FAQ 3 Answer', 'textarea', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
(21, 1, 'faq_4_question', 'How do I backup my data?', 'faq', 'FAQ 4 Question', 'text', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
(22, 1, 'faq_4_answer', 'Go to Administration â†’ Database Backup. You can create manual backups or schedule automatic daily backups. We recommend storing backups in multiple locations.', 'faq', 'FAQ 4 Answer', 'textarea', '2025-12-21 18:55:34', '2025-12-21 19:13:05'),
